  //     .then(res => 
  //       setJokes(...jokes, res.data)
  //     )
  //     .catch(err => console.log(err));
  // };

  // function deleteJoke(id) {
  //   API.deleteJokes(id)
  //     .catch(err => console.log(err));
  // }
  
  return <div>
  <Header />
  <Nav>
  <CreateNewJokeBtn />
  <PersonalPageBtn />
  <LogOutBtn />
  </Nav> 
  <Container> 
  <JokeCard jokes = {jokes} />
  </Container>
  <Footer />
  </div>       
  
}

export default Home;
